  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Willow Creek,
  Pishkun, Benton Lake National Wildlife Refuge outlines Refuge accomplishments from
  May to August 1949. The report begins by summarizing the weather conditions, habitat
  conditions, water conditions, and food and cover during this period. Wildlife- including
  migratory birds is also covered. The public relations section of the report describes
  economic uses.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
